import { Typography, Box } from "@material-ui/core";
import React from "react";
import styles from "./Work.module.css";

const Work = () => {
  return (
    <div>
      <Box>
        <Typography className={styles.title}>My Work</Typography>
      </Box>
    </div>
  );
};

export default Work;
